import React from "react"
import {
    Image
  } from "react-native";


export default function ImgLogin() {

return (
    <Image
    style={{width: 350, height: 100, paddingTop: 150, marginTop: 30, marginBottom: 30}}
        source={require('../images/logo-store.png')}
    />
);
    
}
